import './App.css';
import React, { Component } from 'react'

class App extends Component {

  url = 'http://localhost:8080/user/alex'
  name = ''
  state = {}

  componentDidMount() {
    fetch(this.url, {method: 'POST'})
    .then(res => res.json())
    .then((data) => {
      this.setState({data})
      console.log(this.state)
    })
    .catch(console.log)
  }

  render () {
    return (
      <div className="App-header">
        Data: data goes here {this.state.id}
      </div>
    )
  }
}

